"""# Import required libraries"""

import torch
from llama_cpp import Llama
from diffusers import StableDiffusionInpaintPipeline
from PIL import Image
import numpy as np
import matplotlib.pyplot as plt
from transformers import pipeline

"""# Log in to Hugging Face"""

from huggingface_hub import login

login()

"""# Step 1: Load the quantized model
Load the QwQ-32B-Preview model for text prompt understanding.
"""

print("Loading Llama model...")
llm = Llama.from_pretrained(
    repo_id="bartowski/QwQ-32B-Preview-GGUF",
    filename="QwQ-32B-Preview-IQ2_M.gguf",
)
print("Model loaded.")

"""# Step 2: Extract target and replacement objects from the prompt
Define the prompt describing the replacement task.
"""

prompt = "Replace the bed in the image with a blanket."
response = llm(prompt)  # Use the model to interpret the prompt.
print(f"Model Response: {response}")

"""Parse the response for objects.

"""

target_object = "bed"  # Object to be replaced.
replacement_object = "blanket"  # New object to add.

"""# Step 3: Load the input image
Load the image to be processed.
"""

input_image_path = "/content/Image.png"  # Replace with your actual image path.
input_image = Image.open(input_image_path).convert("RGB")

"""# Step 4: Auto-generate the mask for the target object
Use an image segmentation pipeline to identify the target object in the image.
"""

print("Generating mask for the target object...")
segmentation_pipeline = pipeline("image-segmentation")
segmentation_results = segmentation_pipeline(target_object, images=input_image)

"""Extract the mask from segmentation results.
Initialize a binary mask with zeros.
"""

mask = np.zeros(input_image.size[::-1], dtype=np.uint8)
for segment in segmentation_results:
    if target_object.lower() in segment["label"].lower():
        mask += np.array(segment["mask"], dtype=np.uint8)

"""Ensure the mask is binary (0 or 1)."""

mask = (mask > 0).astype(np.uint8)

"""# Step 5: Replace the object using Stable Diffusion Inpainting
Load the Stable Diffusion Inpainting pipeline for object replacement.
"""

print("Performing object replacement...")
pipe = StableDiffusionInpaintPipeline.from_pretrained("runwayml/stable-diffusion-inpainting")
pipe.to("cuda") if torch.cuda.is_available() else pipe.to("cpu")

"""Convert the binary mask to an image."""

input_mask_image = Image.fromarray(mask * 255)

"""Generate the new image with the replacement object."""

new_image = pipe(
    prompt=replacement_object,
    image=input_image,
    mask_image=input_mask_image
).images[0]

"""# Step 6: Display results
Visualize the original image, mask, and modified image side by side.
"""

plt.figure(figsize=(12, 6))
plt.subplot(1, 3, 1)
plt.title("Original Image")
plt.imshow(input_image)
plt.axis("off")

plt.subplot(1, 3, 2)
plt.title("Generated Mask")
plt.imshow(mask, cmap="gray")
plt.axis("off")

plt.subplot(1, 3, 3)
plt.title("Modified Image")
plt.imshow(new_image)
plt.axis("off")
plt.show()

